function calculTPS(montantSansTaxe){
    return montantSansTaxe * 0.05
}

function calculTVQ(montantSansTaxe, annee){
    if(annee >= 2013){
        return montantSansTaxe * 0.09975
    }
    else if (annee == 2012) {
        return montantSansTaxe * 0.095
    }
    else {
        return montantSansTaxe * 0.085
    }
}
